import axios from "axios";

export const fetchData = (httpMethod) => {
  if (httpMethod === 'get') {
    axios[httpMethod]().then(response => {
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
  } else {
    axios[httpMethod]().then(response => {
      console.log(response.data);
    })
    .catch(error => {
      console.error(error);
    });
  }
}
